column8:
商品の説明<br>
<br>
サンリオの人気キャラ【ポムポムプリン】の可愛いランチ雑貨シリーズ☆彡<br>
<br>
こちらはプリンのフェイス型の可愛いランチボックス<br>
<br>
ふたを外せば電子レンジも使用可能!!<br>
中子も付いているので洗うのもラクラク♪<br>
かわいいプリングッズいろいろあるからコレクションしてね♪<br>
<br>
仕様<br>
<br>
サイズ：約180×105×51mm<br>
<br>
容量：280ml<br>
<br>
カラー イエロー系（黄色）<br>
