商品の説明<br>
<br>
こげ茶色のベレー帽がとてもお気に入り! ポムポムプリン のシール容器セット。<br>
<br>
お弁当箱としてだけではなく、食品の保存容器として、小物入れとして、用途に応じて使い分け! <br>
<br>
入れ子式なので食べ終わった後は1/3に小さくコンパクトに収納可能、<br>
フタを外せば電子レンジ加熱可能、お弁当を食べ終わった後は入れ子に重ねてコンパクトに! 省スペースで持ち帰り可能。<br>
<br>
食材を入れる保存容器としてもとっても便利。冷蔵庫内でもスッキリ重ねて置ける。使わない時は3個入れ子に重ねてコンパクトに収納。<br>
<br>
